		public static async Task<PdfHtmlSource> GenerateHtml(UserOrganizationModel caller, long recurrenceId, QuarterlyController.PrintoutPdfOptions printoutOptions) {
			var angRecur = await L10Accessor.GetOrGenerateAngularRecurrence(caller, recurrenceId, includeHistorical: false, forceIncludeTodoCompletion: true/*recur.IncludeAggregateTodoCompletionOnPrintout*/);
			var vtoModel = VtoAccessor.GetAngularVTO(caller, angRecur.VtoId.Value);
			var org = new AngularOrganization(caller.Organization);

			return await GenerateHtml_InternalAsync(caller, printoutOptions, angRecur, vtoModel, org);
		}

		private static async Task<PdfHtmlSource> GenerateHtml_InternalAsync(UserOrganizationModel caller, QuarterlyController.PrintoutPdfOptions printoutOptions, AngularRecurrence angRecur, AngularVTO vtoModel, AngularOrganization org) {
			AdjustCompanyImage(org);
			AdjustVtoTimezoneOffsets(vtoModel, caller.GetTimeSettings().TimezoneOffset);

			var pdfContent = await GetPartialPagesAsync(caller, angRecur, vtoModel, org, printoutOptions);

			//var pdfContent = string.Join(PageBreak(), pdfPartials);
			//var flatSource = string.Join(PageBreak(), pdfContent);


			return new PdfHtmlSource {
				HtmlPages = pdfContent,
				Headers = GetHeaders(),
				Footers = GetFooters(org)
			};
		}

		public static async Task<Stream> GeneratePdfStreamForRecurrence(UserOrganizationModel caller, IPdfGenerator generator, long recurrenceId, QuarterlyController.PrintoutPdfOptions printoutOptions, PdfPageSettings pdfPageSettings) {
			var angRecur = await L10Accessor.GetOrGenerateAngularRecurrence(caller, recurrenceId, includeHistorical:false, forceIncludeTodoCompletion: true/*recur.IncludeAggregateTodoCompletionOnPrintout*/);
			var vtoModel = VtoAccessor.GetAngularVTO(caller, angRecur.VtoId.Value);
			var angOrg = new AngularOrganization(caller.Organization);

			var pagesAndMeta = await QuarterlyPdf.GenerateHtml_InternalAsync(caller, printoutOptions, angRecur, vtoModel, angOrg);

			var meetingItemStream = await PdfEngine.GeneratePageStreamsFromHtmlString(generator, pagesAndMeta, pdfPageSettings);
			//var vtoAndACStreams = await GetPdfsToBeAppended(caller, vtoModel, angRecur, recurrenceId, printoutOptions);


			var pdfList = new List<StreamAndMeta>();

			pdfList.AddRange(meetingItemStream);

			if (printoutOptions.coverPage) {
				var pageNumbers = new List<PageNumber>();
				var curPage = 2;
				foreach (var p in pdfList) {
					pageNumbers.Add(new PageNumber() { Page = curPage, Title = p.Name });
					curPage = p.Pages + curPage;
				}

				var coverpagePartial = GenerateCoverPageFromMeeting(caller, angOrg, DateTime.UtcNow, pageNumbers, printoutOptions).Generate();
				var coverpageHtml = ViewUtility.RenderView(VIEW, coverpagePartial).Execute();
				var coverpageStream = await PdfEngine.GeneratePageStreamsFromHtmlString(generator, new PdfHtmlSource("", coverpageHtml), pdfPageSettings, includeFooters: false);

				coverpageStream.ForEach(x => x.DrawPageNumber = false);

				pdfList.InsertRange(0, coverpageStream);

			}




			// Merge and prepare file to output
			var pdfStream = PdfEngine.Merge(pdfList); // only pdfsharp has a working Merger for now
			pdfStream.Position = 0;



			return pdfStream;
		}

		private static async Task<List<PageAndMeta>> GetPartialPagesAsync(UserOrganizationModel caller, AngularRecurrence recurrence, AngularVTO vtoModel, AngularOrganization organization, QuarterlyController.PrintoutPdfOptions printoutOptions) {

			var partialPages = new List<PageAndMeta>();


			if (printoutOptions.rocks) {
				partialPages.Add(PageFromPartial(GenerageRocksPage(organization, recurrence, vtoModel)));
			}

			if (printoutOptions.headlines) {
				partialPages.Add(PageFromPartial(GenerateHeadlinesPage(recurrence, organization)));
			}

			if (printoutOptions.vto) {
				partialPages.Add(await GenerateVto(caller, vtoModel));
			}

			if (printoutOptions.acc) {
				partialPages.Add(GenerateAccountabiltyChart(caller, recurrence));
			}

			if (printoutOptions.todos) {
				partialPages.Add(PageFromPartial(GenerateTodosPage(recurrence, organization)));
			}

			if (printoutOptions.issues) {
				partialPages.Add(PageFromPartial(GenerateIssuesPage(recurrence, organization)));
			}

			if (printoutOptions.scorecard) {
				if (recurrence.Scorecard.Measurables.Any()) {
					partialPages.Add(PageFromPartial(GenerateScorecardPage(recurrence, organization)));
				}
			}

			return partialPages;
		}

