		private static PageAndMeta GeneratePeopleAnalyzer(UserOrganizationModel caller, long recurrenceId, PdfSettings settings) {
			try {
				var doc = PdfAccessor.CreateDoc(caller, "Quarterly Printout5");
				var peopleAnalyzer = QuarterlyConversationAccessor.GetVisiblePeopleAnalyzers(caller, caller.Id, recurrenceId);
				var renderer = PeopleAnalyzerPdf.AppendPeopleAnalyzer(caller, doc, peopleAnalyzer, settings, DateTime.MaxValue);
				return PageAndMeta.CreateFromStream("People Analyzer", DocumentToStream((object)renderer));
			} catch (Exception e) {
				//eat it..
				return PageAndMeta.CreateDisabledPage();
			}
		}

		private static PageAndMeta GenerateAccountabiltyChart(UserOrganizationModel caller, AngularRecurrence angRecur) {
			try {
				var tree = AccountabilityAccessor.GetTree(caller, caller.Organization.AccountabilityChartId, expandAll: true);

				var nodes = new List<AngularAccountabilityNode>();
				var topNodes = tree.Root.GetDirectChildren();

				//Add nodes from the tree.
				tree.Dive(x => {
					if (x.User != null && angRecur.Attendees.Any(a => a.Id == x.User.Id))
						nodes.Add(x);
				});

				//Setup if has parents
				foreach (var n in nodes) {
					n._hasParent = topNodes.All(x => x.Id != n.Id);
				}
				var acSettings = new AccountabilityChartPDF.AccountabilityChartSettings(caller.Organization.Settings);
				

				var doc = AccountabilityChartPDF.GenerateAccountabilityChartSmartLevelsMultiDocumentsPerPage(tree, nodes, XUnit.FromInch(11), XUnit.FromInch(8.5), acSettings, true);

				return PageAndMeta.CreateFromStream("Accountability Chart", DocumentToStream((object)doc.Flatten().Document));
			} catch (Exception e) {
				throw;
			}
		}

		private static void AdjustVtoTimezoneOffsets(AngularVTO vtoModel, int offset) {
			if (vtoModel.ThreeYearPicture.FutureDate.HasValue && vtoModel.ThreeYearPicture.FutureDate.Value != vtoModel.ThreeYearPicture.FutureDate.Value.Date)
				vtoModel.ThreeYearPicture.FutureDate = vtoModel.ThreeYearPicture.FutureDate.Value.AddMinutes(offset).Date;
			if (vtoModel.OneYearPlan.FutureDate.HasValue && vtoModel.OneYearPlan.FutureDate.Value != vtoModel.OneYearPlan.FutureDate.Value.Date)
				vtoModel.OneYearPlan.FutureDate = vtoModel.OneYearPlan.FutureDate.Value.AddMinutes(offset).Date;
			if (vtoModel.QuarterlyRocks.FutureDate.HasValue && vtoModel.QuarterlyRocks.FutureDate.Value != vtoModel.QuarterlyRocks.FutureDate.Value.Date)
				vtoModel.QuarterlyRocks.FutureDate = vtoModel.QuarterlyRocks.FutureDate.Value.AddMinutes(offset).Date;
		}

		private static string GetImage(AngularOrganization organization) {
			if (string.IsNullOrEmpty(organization.ImageUrl))
				return CompanyLogoUrl();
			if (organization.ImageUrl.Contains("placeholder"))
				return CompanyLogoUrl();
			return organization.ImageUrl;
		}

		private static PageAndMeta PageFromPartial(IPdfPartial page) {
			return PageAndMeta.CreateFromHtml(page.Title, ViewUtility.RenderView(VIEW, page.Generate()).Execute());
		}

		private static ScorecardsPartial GenerateScorecardPage(AngularRecurrence recurrence, AngularOrganization organization) {
			return new ScorecardsPartial(new ScorecardsPartialViewModel {
				Company = organization.Name,
				Image = GetImage(organization),
				Scorecards = new ScorecardsPartialModel { Scorecard = recurrence.Scorecard }
			});
		}

		private static IssuesPartial GenerateIssuesPage(AngularRecurrence recurrence, AngularOrganization organization) {
			var issues = recurrence.IssuesList.Issues.OrderBy(x => x.Owner.Name).ThenBy(x => x.CreateTime)
				.Select((h, i) => new IssuesPartialModel {
					Issues = h.Name,
					Owner = h.Owner.NotNull(x => x.Name),
					Number = "" + (i + 1)
				}).ToList();

			return new IssuesPartial(new IssuesPartialViewModel {
				Company = organization.Name,
				Image = GetImage(organization),
				Issues = issues
			});
		}

		private static TodosPartial GenerateTodosPage(AngularRecurrence recurrence, AngularOrganization organization) {
			var dateFormat = organization.DateFormat;
			var offset = organization.Timezone.NotNull(x => x.Offset);

			var todos = recurrence.Todos.OrderBy(x => x.Owner.Name).ThenBy(x => x.CreateTime)
				.Select((h, i) => new TodosPartialModel {
					Number = "" + (i + 1),
					Todo = h.Name,
					Owner = h.Owner.NotNull(x => x.Name),
					DueDate = h.DueDate.NotNull(x => TimeData.ConvertFromServerTime(x.Value, offset).ToString(dateFormat))
				}).ToList();

			return new TodosPartial(new TodosPartialViewModel {
				Company = organization.Name,
				Image = GetImage(organization),
				Todos = todos
			});
		}

		private static HeadlinesPartial GenerateHeadlinesPage(AngularRecurrence recurrence, AngularOrganization organization) {
			var headlines = recurrence.Headlines
				.OrderBy(x => x.Owner.Name)
				.ThenBy(x => x.CreateTime)
				.Select(h => new HeadlinesPartialModel {
					Headline = h.Name,
					Owner = h.Owner.NotNull(x => x.Name)
				}).ToList();

			return new HeadlinesPartial(
								new HeadlinesPartialViewModel {
									Company = organization.Name,
									Image = GetImage(organization),
									Headlines = headlines
								});
		}

		private static async Task<PageAndMeta> GenerateVto(UserOrganizationModel caller, AngularVTO vtoModel) {
			var doc = PdfAccessor.CreateDoc(caller, "Quarterly Printout1");
			var vtoSettings = new PdfAccessor.VtoPdfSettings(caller.GetOrganizationSettings()) { MaxSeconds = 10 };
			try {
				await PdfAccessor.AddVTO(doc, vtoModel, caller.GetOrganizationSettings().GetDateFormat(), vtoSettings);
				return PageAndMeta.CreateFromStream("Vision/Traction Organizer™", DocumentToStream((object)doc));
			} catch (LayoutTimeoutException e) {
				// either throw or log. Right now we're throwing
				throw;
			}
		}

