		private static CoverPagePartial GenerateCoverPageFromMeeting(UserOrganizationModel caller, AngularOrganization org, DateTime asOf, List<PageNumber> pageNumbers, QuarterlyController.PrintoutPdfOptions printoutOptions) {
			var values = new OrganizationAccessor().GetCompanyValues(caller, org.Id)
										.Select(v => v.CompanyValue)
										.Where(cv => string.IsNullOrEmpty(cv) == false)
										.ToList();

			var date = caller.GetTimeSettings().ConvertFromServerTime(asOf).ToString(caller.GetTimeSettings().DateFormat);

			var upperHeader = org.Name;
			var lowerHeader = date;
			var imageUrl = org.ImageUrl;

			return GenerateCoverPage("Quarterly Report", upperHeader, lowerHeader, imageUrl, org.HasLogo, values, pageNumbers, printoutOptions);
		}

		private static CoverPagePartial GenerateCoverPage(string primaryHeading, string upperHeading, string lowerHeading, string imageUrl, bool useLogo, List<string> leftListing, List<PageNumber> pageNumbers, QuarterlyController.PrintoutPdfOptions printoutOptions) {
			return new CoverPagePartial(
								new CoverPagePartialViewModel {
									UpperHeading = upperHeading,
									LowerHeading = lowerHeading,
									PrimaryHeading = primaryHeading,
									Image = imageUrl,
									PrintoutPdfOptions = printoutOptions,
									CoreValues = leftListing,
									PageNumbers = pageNumbers,
									UseLogo = useLogo
								})
			;
		}

