		// Francis: Ideally this should be at the PdfSharpGenerator. For some reason it's not detecting the correct object type
		//			Investigate and Refactor
		private static Stream DocumentToStream(object pdfDocument) {
			var pdfStream = new MemoryStream();
			// save to Stream
			if (pdfDocument is PdfDocument pdfDoc) {
				pdfDoc.Save(pdfStream, false);
			} else {
				// Migra Doc, use pdfRenderer
				PdfDocumentRenderer renderer = renderer = new PdfDocumentRenderer(true);
				if (pdfDocument is PdfDocumentRenderer docRenderer) {
					// override current renderer
					renderer = docRenderer;
				}
				// type of document to convert
				else if (pdfDocument is Document migraDoc) {
					renderer.Document = migraDoc;
					renderer.RenderDocument();
				} else {
					throw new ArgumentException();
				}
				renderer.Save(pdfStream, false);
			}
			return pdfStream;
		}

		private static RocksPartial GenerageRocksPage(AngularOrganization organization, AngularRecurrence recurrence, AngularVTO vtoModel) {
			var dateFormat = organization.DateFormat;

			// this could be refactored out
			var defaultValue = DisplayNameStrings.defaultEditMessage;

			// Header
			var headers = vtoModel.QuarterlyRocks.Headers?.Select(rock => {
				var label = (rock.K ?? "").ReplaceNewLineWithBr();
				var value = (rock.V ?? "").Replace(defaultValue, "").ReplaceNewLineWithBr();
				return Tuple.Create(label, value);
			}) ?? new Tuple<string, string>[0];

			// Rocks
			var companyRocks = recurrence.Rocks.Where(x => x.VtoRock == true)
											   .Select(r => new RocksPartialModel {
												   Description = r.Name,
												   Owner = r.Owner.Name,
												   Status = r.Completion
											   });

			var individualRocks = recurrence.Rocks.Select(r => new RocksPartialModel {
				Description = r.Name,
				Owner = r.Owner.Name,
				Status = r.Completion
			});

			var viewData = new RocksPartialViewModel {
				FutureDate = vtoModel.QuarterlyRocks.FutureDate.NotNull(x => x.Value.ToString(dateFormat)) ?? "",
				Headers = headers.ToList(),
				CompanyRocks = companyRocks.ToList(),
				IndividualRocks = individualRocks.ToList(),
				Company = organization.Name,
				Image = GetImage(organization)
			};

			return new RocksPartial(viewData);
		}

